import React from 'react';
import {Field} from "redux-form";
const LoginForm = (props) =>{
    return (
        <form>
            <Field placeholder={"Login"} name={"login"} component={"input"}/>
        </form>
    );
}
const Login = (props) =>{
    return <h1>LOGIN</h1>
}
export default Login;
